import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "../style/CreateClass.css";
import Navbar from "./NavTutor";

const classTypes = [
  "Language",
  "Mathematics",
  "Science",
  "Technology",
  "Art and Design",
  "Business and Finance",
  "Music and Entertainment",
  "Life Skills",
  "Test Preparation",
  "Special Education",
  "Health and Wellness",
];

const EditClassTutor = () => {
  const [classTitle, setClassTitle] = useState("");
  const [classType, setClassType] = useState("");
  const [classDescription, setClassDescription] = useState("");
  const [classLesson, setClassLesson] = useState("");
  const [classPrice, setClassPrice] = useState("");
  const [preview, setPreview] = useState([]);
  const [error, setError] = useState("");
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    job_title: "",
    job_description: "",
    requirements: "",
    location: "",
    salary: "",
    job_type: "",
    application_deadline: "",
  });

  useEffect(() => {
    const fetchJob = async () => {
      try {
        const data = await getJobById(jobId);
        setJob(data);
        setFormData(data); // Mengatur formData ke seluruh data pekerjaan
        setLoading(false);
      } catch (error) {
        console.error("Error fetching job:", error);
      }
    };

    fetchJob();
  }, [jobId]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await updateJob(jobId, formData);
      // Redirect user or show success message
      navigate("/employerhome");
    } catch (error) {
      console.error("Error updating job:", error);
      // Handle error
    }
  };

  return (
    <div>
      <Navbar />
      <div className="create">
        <h2>Class</h2>
        {error && <p style={{ color: "red" }}>{error}</p>}
        <form onSubmit={handleSubmit}>
          <p className="name">Title</p>
          <input
            type="text"
            placeholder="Your class title"
            value={classTitle}
            onChange={(e) => setClassTitle(e.target.value)}
            required
          />
          <p className="name">Descriptions</p>
          <textarea
            placeholder="Enter your class descriptions"
            value={classDescription}
            onChange={(e) => setClassDescription(e.target.value)}
            required
          />
          <p className="name">Class Type</p>
          <select
            value={classType}
            onChange={(e) => setClassType(e.target.value)}
            required
          >
            <option value="">Select...</option>
            {classTypes.map((type, index) => (
              <option key={index} value={type}>
                {type}
              </option>
            ))}
          </select>
          <p className="name">Class Lesson</p>
          <textarea
            placeholder="What is primarily taught in your Class?"
            value={classLesson}
            onChange={handleLessonChange}
            required
          />
          <div className="lesson-preview">
            <h4>Lesson Preview:</h4>
            <ul>
              {preview.map((item, index) => (
                <li key={index}>{item}</li>
              ))}
            </ul>
          </div>
          <p className="name">Price</p>
          <input
            type="text"
            placeholder="Rp.xxx.xxx"
            value={classPrice}
            onChange={(e) => setClassPrice(e.target.value)}
            required
          />
          <button type="submit">Save</button>
        </form>
      </div>
    </div>
  );
};

export default EditClassTutor;
